import React,{useEffect, Fragment} from 'react';
import{ connect }  from "react-redux";
import Spinner from "../layout/Spinner";
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

function GitHubDetail({profile}) {
    return (
        <Fragment>
            <div class="profile-github">
          <h2 class="text-primary my-1">
            <i class="fab fa-github"></i> Github Repos
          </h2>

          {profile.profile.education.map(edu =>(
                <div>
                <h3>{edu.school}</h3>
                <p><Moment format="YYYY/MM/DD">
                    {edu.from}
                </Moment> - {edu.current ? <p>current</p>: <Moment format="YYYY/MM/DD">
                    {edu.to}
                </Moment> }</p>
                <p><strong>Degree: </strong>{edu.degree}</p>
                <p><strong>Field Of Study: </strong>{edu.fieldofstudy}</p>
                <p>
                <strong>Description: </strong>{edu.description}
                </p>
                </div>    
            ))}
          <div class="repo bg-white p-1 my-1">
            <div>
              <h4><a href="#" target="_blank"
                  rel="noopener noreferrer">Repo One</a></h4>
              <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit.
                Repellat, laborum!
              </p>
            </div>
            <div>
              <ul>
                <li class="badge badge-primary">Stars: 44</li>
                <li class="badge badge-dark">Watchers: 21</li>
                <li class="badge badge-light">Forks: 25</li>
              </ul>
            </div>
          </div>
        </div>
        </Fragment>
    )
}

GitHubDetail.propTypes = {
    profile: PropTypes.object.isRequired,

}

export default GitHubDetail
